import NumberInput from '../util/NumberInput';
import PropTypes from 'prop-types';

BalanceCorrection.propTypes = {
    plus: PropTypes.number,
    minus: PropTypes.number,

    setPlus: PropTypes.func,
    setMinus: PropTypes.func,
};

BalanceCorrection.defaultProps = {
    plus: null,
    minus: null,

    setPlus: (v) => {},
    setMinus: (v) => {},
};

export default function BalanceCorrection({plus, minus, setPlus, setMinus}) {
    return(
        <div className='rubric'>
            <div className='title'>{"Korrekturbuchung"}</div>
            <div className='wrapper'>{"Plus-Korrektur: "} <NumberInput value={props.plus} setValue={props.setPlus} /></div>
            <div className='wrapper'>{"Minus-Korrektur: "} <NumberInput value={props.minus} setValue={props.setMinus} /></div>
        </div>
    );
}
